@import '@/assets/styles/sprite-home.scss';

body {
  .app-wide-mode {
    .van-dialog {
      --van-dialog-radius: 18px;
    }
    .van-action-sheet {
      max-width: unset;
      width: 100% !important;
    }
  }
  .circular {
    display: inline;
    height: 84px;
    width: 84px;
    animation: loading-rotate 2s linear infinite;

    .path {
      animation: loading-dash 2s ease-in-out infinite;
      stroke-dasharray: 90, 150;
      stroke-dashoffset: 0;
      stroke-width: 2;
      stroke: var(--van-button-primary-background);
      stroke-linecap: round;
      fill: none;
    }
  }

  .van-toast {
    width: 270px;
    height: 270px;
    padding: 40px;
    font-size: 33px;

    &.van-action-sheet {
      width: 100%;
      height: auto;
      padding: 0;
    }

    .van-toast__icon {
      font-size: 110px;
    }

    .van-toast__text {
      margin-top: 15px;
      line-height: 1.5;
    }
  }
  .order_toast {
    width: 100%;
    max-width: 640px;
    height: auto;
    top: 209px;
    padding: 15px;
    padding-top: 0;
    background-color: #ebf1f6;
    text-align: justify;
  }
  .van-pull-refresh {
    height: 100%;
    overflow-y: auto;
  }

  .f_dialog {
    .van-dialog__footer {
      .van-button {
        background: var(--van-button-primary-background);
      }
    }
  }

  .van-action-sheet {
    max-width: 10rem;
  }
}

@keyframes loading-rotate {
  0% {
    transform: rotate(0deg);
  }

  100% {
    transform: rotate(360deg);
  }
}

@keyframes loading-dash {
